Description : 
Chers clients, nous vous proposons des GPS AUTOMOBILE (système de Géolocalisation) les plus précis et complète pour tracer vos Véhicules, vos Motos et Camions. Ce système vient avec une plateforme et un logiciel avec les fonctionnalités suivantes:



•Suivi en temps réel de l’engin;

•Eteindre le moteur de l’engin à distance;

•Rapport sur la vitesse, le point stationnement, consommation…;

•Délimitation de la zone de circulation de l’engin;

•Limitation de vitesse;

•Historique de parcours.

